import React from "react";
import { ListItem, ListItemText } from "@mui/material";
import StarBorderIcon from '@mui/icons-material/StarBorder';

const CustomListItem = ({ workout, onClick }) => {
    return (
        <ListItem style={styles.listItem} onClick={onClick}>
            <StarBorderIcon style={styles.starIcon} />
            <ListItemText primary={workout.title} secondary={`${workout.description} - ${workout.daysPerWeek} days per week`} />
            <div style={styles.imageContainer}>
                <img src={workout.image} alt={workout.title} style={styles.image} />
            </div>
        </ListItem>
    );
};

const styles = {
    listItem: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
    },
    starIcon: {
        marginRight: 8,
    },
    imageContainer: {
        flexShrink: 0,
        marginLeft: 16, // Adjust as needed
    },
    image: {
        width: 50, // Adjust as needed
        height: 50, // Adjust as needed
        borderRadius: 4, // Adjust as needed
    },
};

export default CustomListItem;
